column8:
うさぎ柄の大きな「もも」が印象的な節句飾り☆<br>
「もも」と「うさぎ」の体部分のちりめんの巾着の中に、老舗お香屋さんの匂香を入れます。<br>
簡単に縫って作れるので、お裁縫の苦手な方もチャレンジしていただけます☆<br>
上品なお香の香る、一味違う節句飾り☆<br>
イチオシです！ <br>
※材料は写真と色・形が変わることがあります<br><br> 
〈サイズ〉約5×5cm <br>
〈用意するもの〉ハサミ、縫い針、縫い糸、ボンド、両面テープ<br> 
難易度：★★☆☆☆<br>
